import React from "react";

function colaborador(id, nombre, apellido, correo, telefono, fechaNacimiento, supervisadoPor) {
  this.id = id;
  this.firstname = nombre;
  this.lastname = apellido;
  this.email = correo;
  this.phone = telefono;
  this.birthdate = fechaNacimiento;
  this.supervisedby_id = supervisadoPor;
}

export default colaborador;
